import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './DisplaySalary.css';

const DisplaySalary = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);

  useEffect(() => {
    const fetchSalaries = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/contracts/${contractId}/salaries`, { params: { month, year } });
        setSalaries(response.data);
      } catch (error) {
        console.error('Error fetching salary records:', error);
      }
    };

    fetchSalaries();
  }, [contractId, month, year]);

  return (
    <div className="salary-display">
      <h2>Salary Details</h2>
      {salaries.length === 0 ? (
        <p>No salary records found for the selected month and year.</p>
      ) : (
        <table className="salary-table">
          <thead>
            <tr>
              <th>Employee Name</th>
              <th>Attendance</th>
              <th>Daily Wage</th>
              <th>Gross Salary</th>
              <th>Employee EPF</th>
              <th>Employee ESIC</th>
              <th>P Tax</th>
              <th>Total Deductions</th>
              <th>Net Salary</th>
              <th>Employer EPF</th>
              <th>Employer ESIC</th>
              <th>Admin Charges</th>
              <th>Contribution</th>
            </tr>
          </thead>
          <tbody>
            {salaries.map((salary, index) => (
              <tr key={index}>
                <td>{salary.employeeId.name}</td>
                <td>{salary.attendance}</td>
                <td>{salary.dailyWage}</td>
                <td>{salary.grossSalary.toFixed(2)}</td>
                <td>{salary.employeeEPF.toFixed(2)}</td>
                <td>{salary.employeeESIC.toFixed(2)}</td>
                <td>{salary.pTax.toFixed(2)}</td>
                <td>{salary.totalDeductions.toFixed(2)}</td>
                <td>{salary.netSalary.toFixed(2)}</td>
                <td>{salary.employerEPF.toFixed(2)}</td>
                <td>{salary.employerESIC.toFixed(2)}</td>
                <td>{salary.adminCharges.toFixed(2)}</td>
                <td>{salary.contribution.toFixed(2)}</td>
              </tr>
            ))}
            <tr className="totals-row">
              <td>Totals</td>
              <td></td>
              <td></td>
              <td>{salaries.reduce((acc, salary) => acc + salary.grossSalary, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.employeeEPF, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.employeeESIC, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.pTax, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.totalDeductions, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.netSalary, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.employerEPF, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.employerESIC, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.adminCharges, 0).toFixed(2)}</td>
              <td>{salaries.reduce((acc, salary) => acc + salary.contribution, 0).toFixed(2)}</td>
            </tr>
          </tbody>
        </table>
      )}
    </div>
  );
};

export default DisplaySalary;
